import { Link } from "react-router-dom";

function Navbar({ isLoggedIn, onLogout }) {
  return (
    <nav style={{ padding: 10, background: "#eee", marginBottom: 20 }}>
      <Link to="/" style={{ marginRight: 10 }}>Trang chủ</Link>
      {!isLoggedIn && <Link to="/signup" style={{ marginRight: 10 }}>Đăng ký</Link>}
      {!isLoggedIn && <Link to="/login">Đăng nhập</Link>}
      {isLoggedIn && (
        <button onClick={onLogout} style={{ marginLeft: 10 }}>
          Đăng xuất
        </button>
      )}
    </nav>
  );
}
export default Navbar;
